import { makeStyles } from "@material-ui/core/styles";

export const useStyles = makeStyles((theme) => ({
	list: {
		// columnCount: 2,
		display: "flex",
		flex: "wrap",
		flexDirection: "column",
		justifyContent: "flex-start",
	},
	listItem: {
		verticalAlign: "top",
	},
	checkbox: {
		padding: 0,
	},
}));
